import { useState } from "react";
import styled from "styled-components";

function App() {
  const Container = styled.div`
    backgroung-color: ${(props) => props.theme.bgColor};
  `;

  const H1 = styled.div`
    color: ${(props) => props.theme.textColor};
  `;

  return (
    <Container>
      <H1>Protected</H1>
    </Container>
  );
}

export default App;
